/********** SCOREBOARD DEFAULT CONFIGURATION BELOW **********/

// Default Timer Length Config (desired seconds - 1)
const LONG_TIMER_SECS = 90 - 1;
const SHORT_TIMER_SECS = 20 - 1;

// Default Team Name Config
const DEFAULT_LEFT_TEAM_NAME = "LEFT<br>TEAM";
const DEFAULT_RIGHT_TEAM_NAME = "RIGHT<br>TEAM";
const MAX_TEAM_NAME_CHAR_LEN = 20;

// Default Length of a Game Config
const DEFAULT_ROUND_MINS = 15;

// Text used to indicate that timer is paused
const PAUSED_TEXT = "||";

// Default Colors Used in the Script
const DEFAULT_PRI_COLOR = "#9D2235";
const DEFAULT_SEC_COLOR = "white";

/********** SCOREBOARD DEFAULT CONFIGURATION ABOVE **********/

const TOGGLE_ON_OFF = 0;
const SET_ON = 1;
const SET_OFF = 2;

let teamAScore = 0;
let teamBScore = 0;
let teamAScoreValue = document.getElementById("teamAScore");
let teamBScoreValue = document.getElementById("teamBScore");

// Vars for timer
let lastQuestionTimer;
let lastRoundTimer;
let lastQuestionTimeAtPause;
let lastRoundTimeAtPause;
let isQuestionTimerPaused;
let isRoundTimerPaused;

// For keypress detection
const pressedKeys = {};

let incrementScore = (team) => {
  if (team === "teamA") {
    teamAScore++;
    teamAScoreValue.textContent = teamAScore;
  } else if (team === "teamB") {
    teamBScore++;
    teamBScoreValue.textContent = teamBScore;
  }
};

let decrementScore = (team) => {
  if (team === "teamA" && teamAScore > 0) {
    teamAScore--;
    teamAScoreValue.textContent = teamAScore;
  } else if (team === "teamB" && teamBScore > 0) {
    teamBScore--;
    teamBScoreValue.textContent = teamBScore;
  }
};

function toggleMarkerColor(marker, modeNum) {
  if (modeNum === 0) {
    if (marker.style.background === DEFAULT_SEC_COLOR) {
      marker.style.background = DEFAULT_PRI_COLOR;
    } else {
      marker.style.background = DEFAULT_SEC_COLOR;
    }
  } else {
    if (modeNum === 1) {
      marker.style.background = DEFAULT_PRI_COLOR;
    } else {
      marker.style.background = DEFAULT_SEC_COLOR;
    }
  }
}

function getTimerText(timer) {
  let minutes, seconds;
  if (timer < 0) timer = 0;

  minutes = parseInt(timer / 60, 10);
  seconds = parseInt(timer % 60, 10);

  minutes = minutes < 10 ? "0" + minutes : minutes;
  seconds = seconds < 10 ? "0" + seconds : seconds;

  return minutes + ":" + seconds;
}

function startTimer(duration, timerElement, intervalToClear) {
  let timer = duration;

  if (intervalToClear) clearInterval(intervalToClear);

  let thisInterval = setInterval(function () {
    if (timer === 10) {
      warningBeep().then(() => {
      });
    }

    if (timer < 0) {
      expiredBeep().then(() => {
      });
      timerElement.textContent = "00:00"
      clearInterval(thisInterval);
    }

    timerElement.textContent = getTimerText(timer);
    timer--;
  }, 1000);

  return thisInterval;
}

function blinkTimer(remainingDuration, timerElement, intervalToClear) {
  let timer = 6000;

  if (intervalToClear) clearInterval(intervalToClear);

  return setInterval(function () {
    timer--;
    if (timer % 2) {
      timerElement.textContent = remainingDuration;
    } else {
      timerElement.textContent = PAUSED_TEXT;
    }
  }, 1000);
}

function warningBeep() {
  const snd = new Audio("data:audio/wav;base64,");
  return snd.play();
}

function expiredBeep() {
  const snd = new Audio("data:audio/wav;base64,");
  return snd.play();
}

function resetQuestionTimer() {
  document.querySelector('#bigTimerRightMarker').style.background = DEFAULT_SEC_COLOR;
  document.querySelector('#bigTimerLeftMarker').style.background = DEFAULT_SEC_COLOR;
  document.querySelector('#bigTimerCountdown').textContent = '--:--';

  clearInterval(lastQuestionTimer);
  lastQuestionTimer = null;
}

function startLongTimer(isLeftTeam, lastQuestionTimer) {
  if (isLeftTeam) {
    toggleMarkerColor(document.querySelector('#bigTimerLeftMarker'), SET_ON);
    toggleMarkerColor(document.querySelector('#bigTimerRightMarker'), SET_OFF);
  } else {
    toggleMarkerColor(document.querySelector('#bigTimerLeftMarker'), SET_OFF);
    toggleMarkerColor(document.querySelector('#bigTimerRightMarker'), SET_ON);
  }

  let bigTimer = document.querySelector('#bigTimerCountdown');
  bigTimer.textContent = getTimerText(LONG_TIMER_SECS + 1);

  return startTimer(LONG_TIMER_SECS, bigTimer, lastQuestionTimer);
}

function startShortTimer(lastQuestionTimer) {
  toggleMarkerColor(document.querySelector('#bigTimerRightMarker'), SET_ON);
  toggleMarkerColor(document.querySelector('#bigTimerLeftMarker'), SET_ON);

  let bigTimer = document.querySelector('#bigTimerCountdown');
  bigTimer.textContent = getTimerText(SHORT_TIMER_SECS + 1);

  return startTimer(SHORT_TIMER_SECS, bigTimer, lastQuestionTimer);
}

function pauseTimer(isPaused, timerDisplay, lastTimeAtPause, lastTimer) {
  clearInterval(lastTimer);
  let timeComponents, seconds;

  if (isPaused) { // unpause
    timerDisplay.textContent = lastTimeAtPause;
    timeComponents = lastTimeAtPause.split(":");

    let seconds = Number(timeComponents[0]) * 60 + Number(timeComponents[1] - 1);
    return startTimer(seconds, timerDisplay, lastTimer);
  } else { // pause
    lastTimeAtPause = timerDisplay.textContent;
    timerDisplay.textContent = PAUSED_TEXT;

    return blinkTimer(lastTimeAtPause, timerDisplay, lastTimer);
  }
}

function pauseQuestionTimer() {
  let bigTimer;
  if (lastQuestionTimer) {
    bigTimer = document.querySelector('#bigTimerCountdown');
    lastQuestionTimeAtPause = isQuestionTimerPaused ? lastQuestionTimeAtPause : bigTimer.textContent;

    lastQuestionTimer = pauseTimer(isQuestionTimerPaused, bigTimer, lastQuestionTimeAtPause, lastQuestionTimer);
    isQuestionTimerPaused = !isQuestionTimerPaused;
  }
}

function pauseRoundTimer() {
  let smallTimer;
  if (lastRoundTimer) {
    smallTimer = document.querySelector('#smallTimerCountdown');
    lastRoundTimeAtPause = isRoundTimerPaused ? lastRoundTimeAtPause : smallTimer.textContent;

    lastRoundTimer = pauseTimer(isRoundTimerPaused, smallTimer, lastRoundTimeAtPause, lastRoundTimer);
    isRoundTimerPaused = !isRoundTimerPaused;
  }
}

function shortenTeamName(teamName) {
  if (teamName.length > MAX_TEAM_NAME_CHAR_LEN) {
    return teamName.substring(0, MAX_TEAM_NAME_CHAR_LEN) + " ...";
  } else {
    return teamName;
  }
}

function editTeamNames() {
  let leftTeamName = shortenTeamName(prompt("Left team name?"));
  let rightTeamName = shortenTeamName(prompt("Right team name?"));

  document.querySelector('#leftTeamName').textContent =
      leftTeamName ? leftTeamName : DEFAULT_LEFT_TEAM_NAME;
  document.querySelector('#rightTeamName').textContent =
      rightTeamName ? rightTeamName : DEFAULT_RIGHT_TEAM_NAME;
}

function isKeyPressed(keyCode) {
  return pressedKeys[keyCode] === true;
}

document.addEventListener('keydown', (e) => {
  pressedKeys[e.keyCode] = true;
});

document.addEventListener('keyup', (e) => {
  delete pressedKeys[e.keyCode];
});

document.onkeyup = function () {
  if (!isKeyPressed(65)) {
    document.querySelector('#leftTeamBox').style.backgroundColor = "";
  }
  if (!isKeyPressed(68)) {
    document.querySelector('#rightTeamBox').style.backgroundColor = "";
  }
}

document.onkeydown = function () {
  var e = e || window.event; // for IE to cover IEs window event-object

  if (e.which === 84) { // 't' key - edit team names
    editTeamNames();
  }
  if (isKeyPressed(65)) { // 'a' key is down (LEFT)
    document.querySelector('#leftTeamBox').style.backgroundColor = DEFAULT_PRI_COLOR;
  }
  if (isKeyPressed(68)) { // 'd' key is down (RIGHT)
    document.querySelector('#rightTeamBox').style.backgroundColor = DEFAULT_PRI_COLOR;
  }
  if (isKeyPressed(65) && isKeyPressed(87)) { // 'a' + 'w' keys (LEFT and UP)
    console.log("Incrementing LEFT team's score and resetting the timer.");
    incrementScore('teamA');
  }
  if (isKeyPressed(68) && isKeyPressed(87)) { // 'd' + 'w' keys (RIGHT and UP)
    console.log("Incrementing RIGHT team's score and resetting the timer.");
    incrementScore('teamB');
  }
  if (isKeyPressed(65) && isKeyPressed(83)) { // 'a' + 'w' keys (LEFT and DOWN)
    console.log("Decrementing LEFT team's score.");
    decrementScore('teamA');
  }
  if (isKeyPressed(68) && isKeyPressed(83)) { // 'a' + 'w' keys (RIGHT and DOWN)
    console.log("Decrementing RIGHT team's score.");
    decrementScore('teamB');
  }
  if (!isRoundTimerPaused) {

    // Question Control Keys
    if (!isQuestionTimerPaused) {
      if (e.which === 37) { // 'arrow left' key
        console.log("Follow up for the LEFT team.");
        lastQuestionTimer = startLongTimer(true, lastQuestionTimer);
        return false;
      }
      if (e.which === 39) { // 'arrow right' key
        console.log("Follow up for the RIGHT team.");
        lastQuestionTimer = startLongTimer(false, lastQuestionTimer);
        return false;
      }
      if (e.which === 38) { // 'arrow up' key
        console.log("Toss up!");
        lastQuestionTimer = startShortTimer(lastQuestionTimer);
        return false;
      }
      if (e.which === 40) { // 'arrow down' key
        console.log("Resetting the question timer.");
        resetQuestionTimer();
        return false;
      }
    }
    if (e.which === 32) { // 'space bar' key
      console.log("Pause/unpause requested for question timer.");
      pauseQuestionTimer();
      return false;
    }

    // Claim Indicators Control Keys
    if (e.which === 219) { // '[' key - toggle LEFT team indicator on/off
      console.log("Manually toggling LEFT claim indicator.")
      toggleMarkerColor(document.querySelector('#bigTimerLeftMarker'), TOGGLE_ON_OFF);
    }
    if (e.which === 221) { // ']' key - toggle RIGHT team indicator on/off
      console.log("Manually toggling RIGHT claim indicator.")
      toggleMarkerColor(document.querySelector('#bigTimerRightMarker'), TOGGLE_ON_OFF);
    }
    if (e.which === 220) { // '\' key - reset team indicators
      console.log("Manually switching off BOTH claim markers.")
      toggleMarkerColor(document.querySelector('#bigTimerRightMarker'), SET_OFF);
      toggleMarkerColor(document.querySelector('#bigTimerLeftMarker'), SET_OFF);
    }
  }
  if (e.which === 27) { // 'ESC' key
    console.log("Pause/unpause requested for round timer.");
    if (!isQuestionTimerPaused) pauseQuestionTimer();
    pauseRoundTimer();
    return false;
  }
}

window.onload = function () {
  let roundDurationInput = prompt("Number of minutes in game?");
  let roundDuration = (isNaN(roundDurationInput) ? (roundDurationInput > 0 ? roundDurationInput : DEFAULT_ROUND_MINS) : DEFAULT_ROUND_MINS) * 60;
  let smallTimer = document.querySelector('#smallTimerCountdown');

  alert("Press ESC (unpause round timer) to begin.")

  smallTimer.textContent = getTimerText(roundDuration);
  lastRoundTimer = startTimer(roundDuration, smallTimer, null);

  toggleMarkerColor(document.querySelector('#bigTimerRightMarker'), SET_OFF);
  toggleMarkerColor(document.querySelector('#bigTimerLeftMarker'), SET_OFF);

  pauseRoundTimer();
};
